import React, { Component } from "react";
import classes from "./Home.module.css";
import LoginForm from './LoginForm/LoginForm';

class Home extends Component {

    render() {
        return (
            <div className={classes.Home}>
                <LoginForm />
            </div>
        );
    }
}

export default Home;
